import React, { useEffect, useState } from "react";
import { useLocation, Link, useNavigate } from "react-router-dom";
import "./RoomsPage.scss";

const RoomsPage = () => {
  const [rooms, setRooms] = useState<any[]>([]);
  const [sortedRooms, setSortedRooms] = useState<any[]>([]);
  const [error, setError] = useState<string | null>(null);
  const [sortOrder, setSortOrder] = useState<"asc" | "desc" | "none">("none");
  const [capacityFilter, setCapacityFilter] = useState<string>("");

  const location = useLocation();
  const navigate = useNavigate();
  const { checkInDate, checkOutDate } = location.state || {};

  useEffect(() => {
    fetch("http://localhost:5000/rooms")
      .then((res) => res.json())
      .then((data) => {
        setRooms(data);
        setSortedRooms(data);
      })
      .catch((err) => setError("Помилка при завантаженні номерів"));
  }, []);

  const filteredRooms = sortedRooms.filter((room) => {
    if (checkInDate && checkOutDate) {
      const availableFrom = new Date(room.available_from).getTime();
      const availableTo = new Date(room.available_to).getTime();
      const inTime = new Date(checkInDate).getTime();
      const outTime = new Date(checkOutDate).getTime();
      return availableFrom <= inTime && availableTo >= outTime;
    }
    return true;
  });

  const finalFilteredRooms = filteredRooms.filter((room) => {
    if (capacityFilter) return room.capacity === parseInt(capacityFilter);
    return true;
  });

  return (
    <div className="rooms-page">
      <div className="rooms-wrapper">
        {error && <p style={{ color: "red" }}>{error}</p>}
        <div className="filters">
          <div className="filter-group">
            <label htmlFor="sortOrder">Сортувати за ціною</label>
            <select id="sortOrder" value={sortOrder} onChange={(e) => setSortOrder(e.target.value as any)}>
              <option value="none">Обрати</option>
              <option value="asc">За зростанням</option>
              <option value="desc">За спаданням</option>
            </select>
          </div>
          <div className="filter-group">
            <label htmlFor="capacityFilter">Місткість</label>
            <select id="capacityFilter" value={capacityFilter} onChange={(e) => setCapacityFilter(e.target.value)}>
              <option value="">Обрати</option>
              <option value="1">1 особа</option>
              <option value="2">2 особи</option>
              <option value="3">3 особи</option>
              <option value="4">4 особи</option>
            </select>
          </div>
        </div>
        <ul>
          {finalFilteredRooms.map((room) => (
            <li key={room.id}>
              <p>{room.name} - {room.price} грн/доба</p>
              {room.photo_url && (
                <div className="image-wrapper">
                  <img src={`http://localhost:5000${room.photo_url}`} alt={room.name} />
                </div>
              )}
              <Link
                to={`/rooms/${room.id}`}
                state={{
                  checkInDate,
                  checkOutDate,
                }}
              >
                <button>Переглянути номер</button>
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default RoomsPage;
